import AddPhoneTicketToTechnicien from "views/admin/ticket/PhoneTicket/AddPhoneTicketToTechnicien";
//import PhoneTicketDetails from "views/admin/ticket/PhoneTicket/";
const routes = [
  {
    name: "Acceuil",
    layout: "/admin",
