    component: <Dashboard />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Acceuil",
    layout: "/admin",
    path: "",
    icon: <MdHome className="h-6 w-6" />,
    component: <Dashboard />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Agences",
    layout: "/admin",
    path: "/agence/:clientId/:clientName",
    icon: <MdHome className="h-6 w-6" />,
    component: <AgenceDetails />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Profile",
    layout: "/admin",
    path: "profile",
    icon: <MdPerson className="h-6 w-6" />,
    component: <Profile />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Log out",
    layout: "/auth",
    path: "sign-in",
    icon: <MdLogout className="h-6 w-6" />,
    component: <SignIn />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "calendrier",
    layout: "/admin",
    path: "calendrier",
    icon: <MdEventAvailable className="h-6 w-6" />,
    component: <Calandar />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "sign up",
    layout: "/auth",
    path: "sign-up",
    icon: <MdLogout className="h-6 w-6" />,
    component: <SignUp />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "help",
    layout: "/admin",
    path: "help",
    icon: <MdHelp className="h-6 w-6" />,
    component: <ContactUS />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "modifierprofile",
    layout: "/admin",
    path: "modifier",
    icon: <MdHelp className="h-6 w-6" />,
    component: <ModifierProfile />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Reclamations",
    layout: "/admin",
    path: "reclamations",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <ManageReclamation />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Equipement",
    layout: "/admin",
    path: "equipement",
    icon: <MdEscalator className="h-6 w-6" />,
    component: <Equipement />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Tickets",
    layout: "/admin",
    path: "ticket",
    icon: <MdAirplaneTicket className="h-6 w-6" />,
    component: <TicketMangement />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Client",
    layout: "/admin",
    path: "client",
    icon: <MdPerson className="h-6 w-6" />,
    component: <ClientManagement />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Add",
    layout: "/admin",
    path: "client/add",
    icon: <MdPerson className="h-6 w-6" />,
    component: <AddClient />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "",
    layout: "/admin",
    path: "client/:clientId",
    icon: <MdPerson className="h-6 w-6" />,
    component: <ClientDetails />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "",
    layout: "/admin",
    path: "contrat/:contratId",
    icon: <MdPerson className="h-6 w-6" />,
    component: <ContratDetails />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Contrats",
    layout: "/admin",
    path: "client/contrat",
    icon: <MdPerson className="h-6 w-6" />,
    component: <Contrat />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Add",
    layout: "/admin",
    path: "client/contrat/add",
    icon: <MdPerson className="h-6 w-6" />,
    component: <AddContrat />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Services",
    layout: "/admin",
    path: "client/service",
    icon: <MdPerson className="h-6 w-6" />,
    component: <Services />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Services",
    layout: "/admin",
    path: "client/service/add",
    icon: <MdPerson className="h-6 w-6" />,
    component: <AddService />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Services",
    layout: "/admin",
    path: "client/service/:serviceId",
    icon: <MdPerson className="h-6 w-6" />,
    component: <ServicesDetails />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "client",
    layout: "/admin",
    path: "client/liste",
    icon: <MdPerson className="h-6 w-6" />,
    component: <Client />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "history",
    layout: "/admin",
    path: "history",
    icon: <MdHistory className="h-6 w-6" />,
    component: <History />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Reported ",
    layout: "/admin",
    path: "reported",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <RecRep />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Liste Technicien ",
    layout: "/admin",
    path: "liste technicien",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <ListeTechniciens />,
    allowedRoles: ["COORDINATRICE"],
  },


  {
    name: "Add ",
    layout: "/admin",
    path: "add/equipement",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <AddEquipement />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Equiment Details",
    layout: "/admin",
    path: "equipement/details/:equipementId",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <EquipementDetails />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Ticket Details",
    layout: "/admin",
    path: "/field/:ticketId",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <FieldDetails />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Ticket Details",
    layout: "/admin",
    path: "/phone/:ticketId",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <PhoneTicketDetails />,
    allowedRoles: ["COORDINATRICE"],
  },
  {

    name: "liste helpdesk",
    layout: "/admin",
    path: "liste helpdesk",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <HelpDeskList />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Equipements",
    layout: "/admin",
    path: "manage/equipement",
    icon: <IoMdTv className="h-6 w-6" />,
    component: <ManagementEquipement />,
    allowedRoles: ["COORDINATRICE"],
  },

  {
    name: "Clients",
    layout: "/admin",
    path: "client/management",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <ClientManagement />,
    allowedRoles: ["COORDINATRICE"],
  },
  /////ADD//
  {
    name: "Add ",
    layout: "/admin",
    path: "add/phone",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <AddPhoneTicket />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Add ",
    layout: "/admin",
    path: "add/field",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <AddFieldTicket />,
    allowedRoles: ["COORDINATRICE"],
  },

  {
    name: "Field  Processing",
    layout: "/admin",
    path: "processing",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <TicketProcessing />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Ticket  Approuval",
    layout: "/admin",
    path: "approval",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <TicketApproval />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Phone  Processing",
    layout: "/admin",
    path: "processing/phone",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <PhoneTicketProcessing />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Phone Tickets",
    layout: "/admin",
    path: "phone",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <PhoneTicket />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Field Tickets",
    layout: "/admin",
    path: "field",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <FieldTicket />,
    allowedRoles: ["COORDINATRICE"],
  },
  {
    name: "Phone Technicien",
    layout: "/admin",
    path: "/",
    icon: <IoMdAlert className="h-6 w-6" />,
    component: <AddPhoneTicketToTechnicien/>,
    allowedRoles: ["COORDINATRICE"],
  },

  {
    name: "No Access",
    layout: "/noacces",
    path: "*",
    component: <NoAccess />,
  },
];
export default routes;
